import React, { useState, useEffect, useContext } from 'react';
import {
    Header, Icon, Form, Image, Message,
    Segment, Grid, Modal, Search, Button, error, Dimmer, Loader, Divider, List
} from 'semantic-ui-react';
import RegistrationStatusCheck from './_RegistrationStatusCheck';


const Registration_First = ({ formData, setForm, navigation }) => {

    const { firstName } = formData;
    console.log(formData)

    const nextFunction = () => {

        navigation.next()
    }

    return (
        <Grid textAlign='center' verticalAlign='middle'>
            <Grid.Column style={{ maxWidth: 450 }}>
                <RegistrationStatusCheck />
                <Header as='h2' color='black' textAlign='center' style={{ padding: "10px" }}>
                    Registration
                    </Header>
                <br />
                <Divider horizontal>Or</Divider>

                <Form size='small'>
                    <Segment stacked>

                        <Form.Input
                            fluid
                            icon='user'
                            iconPosition='left'
                            placeholder='E-mail address'
                            type='text'
                            name="firstName"
                            value={firstName}
                            autoComplete="off"
                            onChange={setForm}
                            required
                            error= {{
                                content: 'Please enter a valid email address',
                                pointing: 'below',
                              }}

                        />

                        <Button
                            color='teal'
                            fluid
                            size='large'
                            onClick={() => nextFunction()}
                        >
                            Next
                        </Button>
                    </Segment>
                </Form>

            </Grid.Column>
        </Grid>
    )

}

export default Registration_First;
